    const [ movies, setMovies ] = useState([])
    const getMovies = () => {
      axios.get('http://localhost:3040/movies')
      .then( movies => {
        console.log("movies : ",movies.data.movies)
        setMovies(movies.data.movies)
    } )
      .catch( err => console.log(err) )
    }
    useEffect(() => {
      getMovies()
    },[])
    return(<>
      AdminHome Page
      {
        movies.map((movie,index) => <Movie key={index} data={movie}></Movie>)
      }

    </>)
 }

